import React from "react";
import {Navbar, NavbarBrand } from "reactstrap";



export default props => {
  return (
      <div>
      <Navbar color="light" light expand="md" className="nav-head">
        <NavbarBrand bg="dark"
          className="nav-brand"
          onClick={_ => {
            props.setPage(0);
          }}
        >
         Book My Table
        </NavbarBrand>
      </Navbar>
      </div>
  );
};
